import HomeHero from "./HomeHero";

const navigation = [
  { name: 'Accueil', href: '/' },
  { name: 'Emploi du temps', href: '#' },
  { name: 'Trombinoscope', href: '#' },
  { name: 'Company', href: '#' },
]


export default function Home() {
  return (
    <>
        <Navbar navigation = { navigation } />
        <HomeHero />

    </>
  );
}
